from typing import List

def majority_element_ii(nums: List[int]) -> List[int]:
    candidate1, candidate2 = None, None
    count1, count2 = 0, 0

    # Step 1: Find the two potential candidates
    for num in nums:
        if candidate1 is not None and num == candidate1:
            count1 += 1
        elif candidate2 is not None and num == candidate2:
            count2 += 1
        elif count1 == 0:
            candidate1 = num
            count1 = 1
        elif count2 == 0:
            candidate2 = num
            count2 = 1
        else:
            count1 -= 1
            count2 -= 1

    # Step 2: Count the occurrences of the potential candidates
    count1, count2 = 0, 0
    for num in nums:
        if num == candidate1:
            count1 += 1
        elif num == candidate2:
            count2 += 1

    # Step 3: Check if the candidates appear more than ⌊ n/3 ⌋ times
    result = []
    if count1 > len(nums) // 3:
        result.append(candidate1)
    if count2 > len(nums) // 3:
        result.append(candidate2)

    return result
